INSERT INTO `pc_configs` (`id`, `name`, `status`, `hide`, `brandid`, `created_at`, `updated_at`, `value`) VALUES
(1, 'LOGO', 1, 0, 1, '2020-09-04 04:52:58', '2020-09-04 04:52:58', '/frontend/images/logo.png'),
(2, 'FOOTER', 1, 0, 1, '2021-10-25 08:02:17', '2020-07-14 08:37:59', 'Kids and grown-ups love it so, the happy world of Haribo!'),
(9, 'FAVICON', 1, 0, 1, '2020-09-04 07:30:17', '2020-09-04 07:30:17', '/frontend/images/bear.png'),
(10, 'SHOWLANG', 1, 0, 1, '2020-08-14 04:38:28', '0000-00-00 00:00:00', '1'),
(11, 'FB', 1, 0, 1, '2020-09-04 07:21:44', '2020-09-04 07:21:44', 'haribovietnam'),
(12, 'TW', 1, 0, 1, '2020-09-04 07:21:44', '2020-09-04 07:21:44', 'haribovietnam'),
(13, 'IN', 1, 0, 1, '2020-09-04 07:21:44', '2020-09-04 07:21:44', 'haribovietnam'),
(14, 'LI', 1, 0, 1, '2021-10-25 08:52:18', '2021-10-25 08:52:18', NULL),
(15, 'EMAIL', 1, 0, 1, '2021-10-27 04:42:34', '2021-10-27 04:42:34', 'sanquaharibo@gmail.com'),
(16, 'PHONE', 1, 0, 1, '2021-10-25 09:50:59', '2021-10-25 09:50:59', '1900 636 519'),
(17, 'ADDRESS', 1, 0, 1, '2021-10-27 04:44:02', '2021-10-27 04:44:02', 'Số 41 đường Thảo Điền, phường Thảo Điền, thành phố Thủ Đức, Thành phố Hồ Chí Minh.'),
(18, 'COMPANY', 1, 0, 1, '2021-10-27 04:43:40', '2021-10-27 04:43:40', 'Công ty TNHH Thực phẩm  Ân Nam'),
(19, 'TOPBANNER', 1, 0, 1, '2021-10-25 07:28:56', '2021-10-25 07:28:56', '/frontend/images/banner/abcbn.png'),
(20, 'MIDBANNER', 1, 0, 1, '2020-09-07 04:09:24', '2020-09-07 04:09:24', '/frontend/images/banner/bn2.jpg'),
(21, 'ABOUTCONTENT1', 1, 0, 1, '2021-11-09 02:30:39', '2021-11-09 02:30:39', '<div style=\"margin-left: 40px;\"><strong>-</strong> Haribo là thương hiệu kẹo dẻo cao cấp lớn nhất thế giới, được thành lập năm 1921 bởi Hans Riegel tại <span style=\"color:#FF0000;\"><strong>Đức</strong></span>.<br />\r\n<strong>-</strong> Là công ty tiên phong trong việc sản xuất các dòng kẹo dẻo mới.<br />\r\n<strong>-</strong> Thương hiệu được yêu thích và phân phối rộng rãi tại hơn 110 quốc gia, bao gồm Việt Nam.</div>'),
(22, 'ABOUTCONTENT2', 1, 0, 1, '2021-11-08 11:56:52', '2021-11-08 11:56:52', '<div style=\"margin-left: 40px;\"><strong>-</strong> Tất cả sản phẩm được sản xuất từ nước ép trái cây nguyên chất<br />\r\n<strong>-</strong> Không chất tạo màu, tạo mùi nhân tạo<br />\r\n<strong>-</strong> Mùi vị thơm ngon, đa dạng<br />\r\n<strong>-</strong> Công thức sản xuất từ Đức</div>'),
(23, 'ABOUTIMG1', 1, 0, 1, '2021-10-25 10:44:08', '2021-10-25 10:44:08', '/frontend/images/haribo-about-1.png'),
(24, 'ABOUTIMG2', 1, 0, 1, '2021-10-25 10:44:32', '2021-10-25 10:44:32', '/frontend/images/haribo-about-3.png'),
(25, 'REGIMG', 1, 0, 1, '2021-10-25 09:55:09', '2021-10-25 09:55:09', '/frontend/images/haribo-1.png'),
(26, 'TITLE', 1, 0, 1, '2021-10-25 08:52:19', '2021-10-25 08:52:19', 'SĂN NGAY HARIBO - TRÚNG NGAY QUÀ XỊN'),
(27, 'TITLE1', 1, 0, 1, '2021-10-26 04:29:01', '2021-10-26 04:29:01', 'SĂN NGAY HARIBO - TRÚNG NGAY QUÀ XỊN'),
(28, 'BOX1', 1, 0, 1, '2021-10-26 04:29:01', '2021-10-26 04:29:01', '<div>Khách hàng khi mua bất kỳ 01 gói kẹo dẻo Haribo 80g có dán tem chương trình khuyến mại ở mặt sau sẽ nhận được một Mã dự thưởng dùng để tham gia chương trình bốc thăm trúng thưởng.</div>\r\n\r\n<div style=\"margin-left: 40px;\">+ Từ ngày 01/11/2021 - 31/12/2021<br />\r\n+ Địa điểm: Toàn quốc</div>'),
(29, 'TITLE2', 1, 0, 1, '2020-09-04 06:49:55', '2020-09-04 06:49:55', 'Cách thức tham gia'),
(30, 'BOX2', 1, 0, 1, '2021-10-26 04:29:01', '2021-10-26 04:29:01', '<div>Khách hàng mua bất kỳ 01 sản phẩm kẹo Haribo 80g có tem chương trình ở mặt sau sẽ nhận được mã dự thưởng (được dán ở mặt sau của bao bì) <br />\r\nKhách hàng có 2 cách để đăng ký tham gia chương trình</div>\r\n\r\n<div style=\"margin-left: 40px;\">+ Nhắn tin theo cú pháp</div>\r\n\r\n<div style=\"margin-left: 40px;\">+ Đăng ký thông qua website</div>'),
