(35, 'PROGRAM', 1, 0, 1, '2021-10-27 02:39:50', '2021-10-27 02:39:50', '<ol>\r\n	<li><u><strong> Tên chương trình khuyến mại</strong></u><br />\r\n	\"SĂN NGAY HARIBO - TRÚNG NGAY QUÀ XỊN\"<br />\r\n	 </li>\r\n	<li><u><strong>Thời gian khuyến mại</strong></u><br />\r\n	Từ ngày 01/11/2021 - 31/12/2021<br />\r\n	 </li>\r\n	<li><u><strong>Hàng hoá, dịch vụ khuyến mại</strong></u><br />\r\n	Khách hàng khi mua bất kỳ 01 gói kẹo dẻo Haribo 80g có dán tem chương trình khuyến mại ở mặt sau sẽ nhận được một Mã dự thưởng dùng để tham gia chương trình bốc thăm trúng thưởng.<br />\r\n	 </li>\r\n	<li><u><strong>Hàng hoá, dịch vụ dùng để khuyến mại</strong></u><br />\r\n	Chỉ vàng SJC <br />\r\n	Gấu bông Haribo<br />\r\n	 </li>\r\n	<li><u><strong>Địa bàn (phạm vi) khuyến mại</strong></u><br />\r\n	Trên toàn lãnh thổ Việt Nam<br />\r\n	 </li>\r\n	<li><u><strong>Hình thức khuyến mãi:</strong></u><br />\r\n	Phần mềm tự động sẽ quay số ngẫu nhiên tất cả các Mã dự thưởng hợp lệ đã nhắn tin về tổng đài hoặc đăng kí thông tin kèm mã dự thưởng tới website chương trình từ 0h00 ngày 01/11/2021 đến 23h59 ngày 31/12/2021 để chọn ra những khách hàng may mắn trúng giải.<br />\r\n	 </li>\r\n	<li><u><strong>Đối tượng áp dụng</strong></u><br />\r\n	- Cá nhân đang sinh sống và làm việc tại Việt Nam, có đủ năng lực pháp luật dân sự và năng lực hành vi dân sự theo pháp luật Việt Nam, thực hiện hoạt động mua hàng kẹo Haribo tại các điểm bán trên toàn quốc<br />\r\n	-Chương trình không áp dụng cho nhân viên của Công ty TNHH Thực Phẩm Ân Nam, Công ty TNHH Jacobins Digital, Công ty Cổ phần Xích Việt, Công ty TNHH dịch vụ tiếp thị Quang Anh, Công ty TNHH Sao Thiên Hà, Công ty TNHH Phân Phối Sành Điệu; nhân viên của các đối tác hỗ trợ hoặc/và cung cấp dịch vụ hoặc hàng hóa có liên quan trực tiếp và gián tiếp (in ấn, quảng cáo, đăng ký chương trình, truyền thông,...) cùng Công ty TNHH Thực Phẩm Ân Nam thực hiện chương trình khuyến mại này.<br />\r\n	 </li>\r\n	<li><u><strong>Cơ cấu giải thưởng</strong></u><br />\r\n	Giải nhất: 30 chỉ vàng SJC <br />\r\n	Giải nhì: 150 gấu bông Haribo<br />\r\n	 </li>\r\n	<li><u><strong>Nội dung chi tiết thể lệ chương trình khuyến mại</strong></u><br />\r\n	<br />\r\n	<u><strong>9.1 Điều kiện, cách thức, thủ tục cụ thể khách hàng phải thực hiện để được tham gia chương trình khuyến mại:</strong></u><br />\r\n	- Khách hàng mua bất kỳ 01 sản phẩm kẹo Haribo 80g có tem chương trình ở mặt sau sẽ nhận được mã dự thưởng (được dán ở mặt sau của bao bì) <br />\r\n	- Khách hàng có 2 cách để đăng ký tham gia chương trình:<br />\r\n	 + Cách 1: Nhắn tin theo cú pháp: “HRB<khoảng c=\"\">Mã dự thưởng” gửi đến tổng đài 6067 (1.000đ/tin nhắn). Trong đó: “Mã Dự Thưởng” gồm 9 ký tự có ở mặt sau bao bì sản phẩm khuyến mại.<br />\r\n	     Chi phí cho mỗi tin nhắn khi tham gia chương trình khuyến mại thông qua tổng đài 6067 là 1.000đ. Chi phí này sẽ do khách hàng chịu.<br />\r\n	+ Cách 2: Đăng ký thông qua website của chương trình (www.sanquaharibo.com). Khách lên website chương trình điền đầy đủ các thông tin theo yêu cầu: Họ và tên, số điện thoại, email, mã dự thưởng, địa chỉ và gửi về chương trình.<br />\r\n	- Thời gian khách hàng đăng ký tham gia chương trình bằng một trong hai cách trên từ 0h00 ngày 01/11/2021 đến 23h59 ngày 31/12/2021.<br />\r\n	- Khách hàng có thể gửi nhiều Mã Dự Thưởng nếu khách hàng mua nhiều sản phẩm khuyến mại. Nếu các Mã Dự Thưởng trúng thưởng thì khách hàng sẽ được nhận những giải thưởng tương ứng với số Mã Dự Thưởng trúng thưởng.<br />\r\n	- Mã Dự Thưởng phải được gửi trong thời gian khuyến mại của chương trình, ngoài thời gian trên sẽ được coi là không hợp lệ.<br />\r\n	<br />\r\n	<u><strong>9.2. Thời gian, cách thức phát hành bằng chứng xác định trúng thưởng:</strong></u><br />\r\n	- Cách thức xác định trúng thưởng: Tất cả các giải thưởng sẽ được quay bẳng phần mềm tự động quay số ngẫu nhiên cho tất cả các Mã Dự Thưởng hợp lệ đã nhắn tin về tổng đài hoặc đăng ký thành công qua website của chương trình để chọn 30 khách hàng may mắn trúng giải nhất và 150 giải nhì. Thứ tự xác định trúng thưởng: <br />\r\n	Đợt 1 diễn ra vào ngày 07/12/2021 bao gồm 15 giải nhất và 75 giải nhì sẽ được phần mềm quay ngẫu nhiên trong danh sách các mã dự thưởng.<br />\r\n	Đợt 2 diễn ra vào ngày 11/01/2022 bao gồm 15 giải nhất và 75 giải nhì sẽ được phần mềm quay ngẫu nhiên trong danh sách các mã dự thưởng còn lại (không bao gồm 90 mã dự thưởng đã trúng giải Đợt 1.<br />\r\n	<br />\r\n	<u><strong>9.3. Quy định về bằng chứng xác định trúng thưởng</strong></u><br />\r\n	- Mã Dự Thưởng sẽ bao gồm 9 ký tự ngẫu nhiên cả số và chữ in trên 1 tem chương trình được dán ở mặt sau bao bì các sản phẩm khuyến mại. Ví dụ: BD13ed393.<br />\r\n	- Vỏ bao bì sản phẩm khuyến mại có tem dự thưởng là cơ sở để nhận giải thưởng vì vậy người trúng thưởng có trách nhiệm cung cấp chính xác thông tin khi tham dự chương trình cũng như xuất trình khi nhận giải thưởng (nếu trúng thưởng).<br />\r\n	- Khách hàng giữ lại cả bao bì và phần tem chương trình. Phần tem chương trình vẫn còn nguyên trên bao bì, không bị rách.<br />\r\n	<br />\r\n	<u><strong>9.4. Quy định về thời gian, địa điểm và cách thức xác định trúng thưởng:</strong></u><br />\r\n	Khách hàng mua sản phẩm khuyến mại, tìm Mã dự thưởng bên phía sau bao bì và gửi tin nhắn đến tổng đài 6067 hoặc đăng ký qua website của chương trình để tham gia chương trình khuyến mại.<br />\r\n	- Nếu khách hàng đăng ký qua website của chương trình, thì khách hàng sẽ nhận được email xác nhận đăng kí tham gia chương trình thành công.<br />\r\n	- Nếu khách hàng nhắn tin về tổng đài 6067, tổng đài 6067 sẽ nhắn tin cho khách hàng (theo số điện thoại mà khách hàng đã nhắn tin về tổng đài) nội dung như sau: \"Cam on ban da tham gia chuong trinh San ngay Haribo Trung ngay qua xin. Vui long giu ma du thuong va theo doi ket qua tai www.sanquaharibo.com.\"<br />\r\n	- Mã Dự Thưởng của khách hàng sau khi nhắn tin hợp lệ/đăng ký thành công trên website chương trình (tin nhắn đúng cú pháp/điền đủ thông tin yêu cầu trên website, đúng thời gian quy định và đúng mã dự thưởng) về cho tổng đài/webiste chương trình sẽ được tổng hợp và lưu giữ cho việc rút thăm may mắn vào cuối chương trình<br />\r\n	 Cách thức xác định trúng thưởng: Quay số bằng phần mềm tự động<br />\r\n	<br />\r\n	<u><strong>9.5. Thông báo trúng thưởng</strong></u><br />\r\n	- Tất cả các giải thưởng sẽ được công bố trên website của chương trình (www.sanquaharibo.com) trong vòng 7 ngày sau khi có kết quả quay phần mềm trúng thưởng của từng đợt.<br />\r\n	- Trong vòng 15 ngày kể từ ngày có kết quả chính thức của chương trình rút thăm trúng thưởng, công ty TNHH Thực Phẩm Ân Nam sẽ gọi điện 1 lần để thông báo trúng thưởng cho khách hàng. Trường hợp không liên lạc được trong 1 lần gọi do bất kỳ lý do nào (cung cấp sai số điện thoại, không bắt máy, không có sóng, ...), chương trình sẽ để lại 01 tin nhắn sms yêu cầu khách hàng liên hệ lại với chương trình và cung cấp các thông tin chương trình yêu cầu.\"<br />\r\n	- Sau đó thì tất cả các khách hàng phải cung cấp thông tin chương trình yêu cầu qua các ứng dụng nhắn tin Zalo, Viber cho chương trình khi được liên hệ trước để xác nhận là giải thưởng hợp lệ chậm nhất trong vòng 03 ngày làm việc kể từ lúc nhận được cuộc gọi hoặc tin nhắn SMS thông báo trúng thưởng từ chương trình. Nếu quá thời gian 03 ngày làm việc tính từ thời điểm chương trình gọi điện hoặc gửi tin nhắn sms cho người trúng thưởng mà người trúng thưởng không liên hệ lại hoặc đã liên hệ lại nhưng không gửi đầy đủ thông tin theo yêu cầu ở trên thì được xem là Giải thưởng không có người trúng thưởng. <br />\r\n	Các thông tin cần cung cấp bao gồm:<br />\r\n	• Số điện thoại khách hàng sử dụng nhắn tin tham gia chương trình hoặc đăng ký tham gia chương trình trên website<br />\r\n	• Hình ảnh bao bì sản phẩm có mã dự thưởng trúng thưởng <br />\r\n	• Họ tên, địa chỉ đăng ký nhận giải thưởng trường hợp nếu khách hàng trúng giải nhì chương trình\"<br />\r\n	*Lưu ý: Nếu Đợt 1, Đợt 2 có giải thưởng không có người nhận thưởng thì phần thưởng sẽ giải quyết theo quy định pháp luật (công ty TNHH Thực Phẩm Ân Nam có trách nhiệm trích nộp bằng tiền mặt 50% giá trị đã công bố của giải thưởng để nộp Ngân sách Nhà nước).<br />\r\n	<br />\r\n	<u><strong>9.6. Thời gian địa điểm, cách thức và thủ tục trao thưởng</strong></u><br />\r\n	- Thời hạn trao thưởng: trong vòng 45 ngày kể từ ngày kết thúc thời gian khuyến mại.<br />\r\n	- Địa điểm trao thưởng: <br />\r\n	 + Giải nhất Chỉ vàng SJC: <br />\r\n	Đơn vị đại diện trao thưởng sẽ gọi điện thoại cho khách hàng nhận thưởng để thống nhất thời gian và địa điểm trao thưởng sau khi xác nhận giải thưởng của người trúng thưởng là hợp lệ.<br />\r\n	Khách hàng nhận giải thưởng tại địa điểm thống nhất giữa khách hàng và đơn vị đại diện trao giải thưởng. Địa điểm này tại thành phố thuộc tỉnh thành nơi khách hàng đăng ký/ sinh sống. Nếu khách hàng không ở vị trí trung tâm thì khách hàng sẽ tự chịu chi phí di chuyển tới địa điểm nhận giải 2 bên thống nhất.<br />\r\n	+ Giải nhì Gấu bông Haribo: sẽ trao thưởng bằng dịch vụ chuyển phát nhanh của bưu chính theo địa chỉ mà khách hàng cung cấp cho chương trình trong quá trình liên hệ xác nhận trúng thưởng bên trên.<br />\r\n	Chi phí vận chuyển giải thưởng bằng dịch vụ chuyển phát nhanh sẽ do chương trình chịu.<br />\r\n	- Thủ tục trao thưởng:<br />\r\n	*Khách hàng trúng giải nhất:<br />\r\n	- Khách hàng trúng giải nhất phải ký biên bản xác nhận giải thưởng tại địa điểm nhận thưởng và phải chịu trách nhiệm đóng tất cả các loại thuế liên quan theo quy định của Pháp luật Việt Nam về sở hữu tài sản trúng thưởng (thuế thu nhập cá nhân...)<br />\r\n	- Khách hàng trúng giải nhất phải cung cấp đầy đủ các chứng từ sau đây:<br />\r\n	    + Bao bì sản phẩm khuyến mại có mã dự thưởng trúng thưởng<br />\r\n	    + Bản sao CMND/CCCD có công chứng để hoàn thành thủ tục nhận thưởng<br />\r\n	- Khách hàng trúng giải nhất phải chịu trách nhiệm toàn bộ về các chi phí đi lại, ăn ở, chi phí vận chuyển giải thưởng, …<br />\r\n	* Khách hàng trúng giải nhì: <br />\r\n	- Khách hàng có trách nhiệm ký biên nhận xác nhận nhận giải thưởng bằng chuyển phát nhanh khi nhận giải.<br />\r\n	- Khách hàng trúng giải nhì phải cung cấp đầy đủ các chứng từ sau đây:<br />\r\n	   + Hình ảnh chụp bao bì sản phẩm khuyến mại có mã dự thưởng trúng thưởng\"<br />\r\n	*Lưu ý: Đối với khách hàng trúng giải nhất chưa đủ 18 tuổi: cần cung cấp bản sao có chứng thực giấy tờ chứng minh quan hệ giám hộ và giấy tờ nhân thân của người giám hộ.<br />\r\n	 - Các khách hàng trúng giải thưởng của chương trình sẽ chịu trách nhiệm nộp thuế thu nhập cá nhân và các nghĩa vụ tài chính khác (nếu có) khi nhận giải thưởng từ chương trình theo quy định của pháp luật.<br />\r\n	<br />\r\n	<strong>9.7 Quy định về giải thưởng không có người trúng thưởng:</strong><br />\r\n	- Công ty TNHH Thực Phẩm Ân Nam sẽ xác định phần thưởng là Giải thưởng không có người trúng thưởng để nộp Ngân sách Nhà nước theo quy định pháp luật hiện hành nếu thuộc một trong các trường hợp sau đây:<br />\r\n	• Hết thời hạn trao thưởng nhưng không có người nhận;<br />\r\n	• Khách hàng không cung cấp đầy đủ chứng từ được yêu cầu để nhận thưởng;<br />\r\n	• Ban tổ chức không liên hệ được với người trúng thưởng theo thông tin đã được khách hàng cung cấp;<br />\r\n	• Người trúng thưởng không liên hệ với Ban tổ chức để xác nhận nhận thưởng.<br />\r\n	 </khoảng></li>\r\n	<li><u><strong>Đầu mối giải đáp thắc mắc cho khách hàng về các vấn đề liên quan đến chương trình khuyến mại (người liên hệ, điện thoại...):</strong></u><br />\r\n	Công ty TNHH Thực phẩm Ân Nam<br />\r\n	Số 41 đường Thảo Điền, phường Thảo Điền, Thành phố Thủ Đức, Thành phố Hồ Chí Minh, Việt Nam<br />\r\n	Người liên hệ: Tổng đài viên chăm khách hàng hotline<br />\r\n	Hotline: 1900636519<br />\r\n	Điện thoại: 1900636519<br />\r\n	 </li>\r\n	<li><u><strong>Trách nhiệm công bố thông tin:</strong></u><br />\r\n	- Công ty TNHH Thực phẩm Ân Nam sẽ thông báo đầy đủ chi tiết nội dung của thể lệ chương trình khuyến mại này trên website của chương trình www.sanquaharibo.com.<br />\r\n	- Kết quả của chương trình khuyến mại sẽ được công bố đầy đủ tại website www.sanquaharibo.com.<br />\r\n	 </li>\r\n	<li><u><strong>Các qui định khác </strong></u><br />\r\n	- Công ty TNHH Thực Phẩm Ân Nam có trách nhiệm đảm bảo chương trình khuyến mại được tiến hành theo các Điều khoản và Điều kiện nêu tại Thể lệ này, theo pháp luật và các quy định hiện hành của Việt Nam.<br />\r\n	- Bằng việc tham gia chương trình khuyến mại này, người tham gia đồng ý chịu sự ràng buộc của Điều khoản và Điều kiện và quyết định của Công ty TNHH Thực Phẩm Ân Nam. Việc không tuân thủ các Điều khoản và Điều kiện có thể bị truất quyền tham gia và thu hồi giải thưởng. Mọi khiếu nại liên quan đến chương trình khuyến mại sẽ được xử lý dựa trên Điều khoản và Điều kiện nêu tại Thể lệ này và pháp luật Việt Nam.<br />\r\n	- Công ty TNHH Thực Phẩm Ân Nam sẽ không chịu trách nhiệm cho bất kỳ chi phí hay chi phí phát sinh nào của Khách hàng để tham gia chương trình khuyến mại này hoặc để nhận giải thưởng.<br />\r\n	- Số điện thoại đăng ký tham gia chương trình sẽ là phương tiện liên lạc chính và duy nhất, nên người tham gia có trách nhiệm cung cấp số điện thoại chính xác. Công ty TNHH Thực Phẩm Ân Nam sẽ không có trách nhiệm pháp lý trong trường hợp không thể gửi thông báo cho người tham gia do bất kỳ sai sót, hay lỗi của người tham gia và thông tin số điện thoại không chính xác do người tham gia cung cấp.<br />\r\n	- Công ty TNHH Thực Phẩm Ân Nam ( \"Công ty\") và các chi nhánh của Công ty sử dụng tên và/hoặc hình ảnh (tĩnh hoặc /động) và các thông tin cá nhân mà người trúng thưởng được đã cung cấp cho mục đích quảng cáo thương mại trên tất cả các kênh hoặc phương tiện truyền thông (bao gồm mạng xã hội) mà không cần phải trả  bất kỳ chi nào phí khi có sự cho phép người trúng thưởng.<br />\r\n	- Người trúng thưởng phải tự thực hiện thủ tục quyết toán thuế với cơ quan nhà nước theo quy định liên quan đến giải thưởng. <br />\r\n	- Công ty TNHH Thực Phẩm Ân Nam hoàn toàn chịu trách nhiệm trong việc quản lý khâu in ấn, tính chính xác của bằng chứng xác định trúng thưởng và đưa bằng chứng xác định trúng thưởng vào lưu thông trong chương trình khuyến mại<br />\r\n	- Việc tổ chức chương trình khuyến mại phải đảm bảo tính ngẫu nhiên, khách quan và công khai.<br />\r\n	- Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty TNHH Thực Phẩm Ân Nam có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật.<br />\r\n	- Sau khi kết thúc chương trình khuyến mại, Công ty TNHH Thực Phẩm Ân Nam có trách nhiệm báo cáo kết quả thực hiện chương trình khuyến mại trên theo đúng quy định của pháp luật về thời hạn báo cáo, hồ sơ báo cáo và các giấy tờ kèm theo. <br />\r\n	- Công ty TNHH Thực Phẩm Ân Nam sẽ xác định phần thưởng là giải thưởng không có người trúng thưởng và phải có trách nhiệm trích nộp bằng tiền mặt 50% giá trị đã công bố của giải thưởng để nộp Ngân sách Nhà nước theo quy định pháp luật hiện hành.</li>\r\n</ol>'),
